class Usuario{final int? codUsuario;final String nombreUsu;final String contrasenaUsu;final String correo;final String nivelAcceso;final String? estado;final int? codEmpleado;Usuario({this.codUsuario,required this.nombreUsu,required this.contrasenaUsu,required this.correo,required this.nivelAcceso,this.estado,this.codEmpleado});factory Usuario.fromMap(Map<String,dynamic> m)=>Usuario(codUsuario:m['cod_usuario']as int?,nombreUsu:m['nombre_usu'],contrasenaUsu:m['contrasena_usu'],correo:m['correo'],nivelAcceso:m['nivel_acceso'],estado:m['estado'],codEmpleado:m['cod_empleado']as int?);Map<String,dynamic> toMap()=>{'cod_usuario':codUsuario,'nombre_usu':nombreUsu,'contrasena_usu':contrasenaUsu,'correo':correo,'nivel_acceso':nivelAcceso,'estado':estado,'cod_empleado':codEmpleado};}